import './App.css';
import React, { Component } from 'react';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      hora: '00:00:00',
    };
  }

  render() {
    return <div>Hi there {this.state.hora}</div>;
  }
}

export default App;
